import React from "react";
import { useParams } from "react-router-dom";

const DetailJob = (props) => {
  const { params } = props.match;
  // const x = useParams(id);
  let { id } = useParams();
  return (
    <h3>
      ID: {id}
      <div>
        <b>Parameter 1: </b>
        {params.id}
      </div>
      <div>
        <b>Parameter 2: </b>
        {params.company}
      </div>
    </h3>
  );
};

export default DetailJob;
